import React from 'react';
import { Slider, Tooltip, IconButton, Typography, Accordion, AccordionSummary, AccordionDetails } from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import HelpOutlineIcon from '@material-ui/icons/HelpOutline';

export default function Settings() {
  const [activeness, setActiveness] = React.useState(30);
  const [generality, setGenerality] = React.useState(30);
  const [expanded, setExpanded] = React.useState('');

  const handleActivenessChange = (event, newValue) => {
    setActiveness(newValue);
  };

  const handleGeneralityChange = (event, newValue) => {
    setGenerality(newValue);
  };

  const handleAccordion = (panel) => (event, newExpanded) => {
    setExpanded(!panel);
  };

  return (
    <div>
      <Typography variant="h4">Assistant Settings</Typography>
      <h4>
        Activeness
        <Tooltip title="Learn more about Activeness" placement="top">
          <IconButton aria-label="learn more" onClick={handleAccordion('panel1')}>
            <HelpOutlineIcon />
          </IconButton>
        </Tooltip>
      </h4>
      <Slider
        value={activeness}
        onChange={handleActivenessChange}
        defaultValue={3}
        valueLabelDisplay="auto"
        aria-labelledby="activeness-slider"
        step={1}
        marks={true}
        min={1}
        max={5}
      />

      <h4>
        Generality
        <Tooltip title="Learn more about Generality" placement="top">
          <IconButton aria-label="learn more" onClick={handleAccordion('panel2')}>
            <HelpOutlineIcon />
          </IconButton>
        </Tooltip>
      </h4>
      <Slider
        value={generality}
        onChange={handleGeneralityChange}
        defaultValue={2}
        valueLabelDisplay="auto"
        aria-labelledby="generality-slider"
        step={1}
        marks={true}
        min={1}
        max={5}
        size="large"
      />

      <Accordion expanded={expanded === 'panel1'} onChange={handleAccordion('panel1')}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography>More About Activeness</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Detailed description about Activeness
          </Typography>
        </AccordionDetails>
      </Accordion>
      <Accordion expanded={expanded === 'panel2'} onChange={handleAccordion('panel2')}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel2a-content"
          id="panel2a-header"
        >
          <Typography>More About Generality</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Detailed description about Generality
          </Typography>
        </AccordionDetails>
      </Accordion>
    </div>
  );
}
